import React from "react";
import "./settings.css";
import SideBar from './SideBar';

export default function Settings() {
    return (
      <div className='settings'>
        <div className='settingsWrapper'>
          <div className='settingsTitle'>
            <span className='settingsTitleUpdate'>Update Your Account</span>
            <span className='settingsTitleDelete'>Delete Account</span>
          </div>
          <form className='settingsForm'>
            <label>Profile Picture</label>
            <div className='settingsProfilePicture'>
              <img
                src='https://s3.amazonaws.com/shecodesio-production/uploads/files/000/140/171/original/john-bell-haGopMEwC6M-unsplash.jpg?1724123504'
                alt='Wild Coyote'
              />
              <label htmlFor='fileInput'>
                <i className='settingsProfilePictureIcon fa-regular fa-user'></i>{" "}
              </label>
              <input
              id="fileInput"
              type="file"
              style={{display: "none"}}
              className="settingsProfilePicturreInput"/>
            </div>
          </form>
        </div>
        <SideBar />
      </div>
    );
}
